import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Profile = ({ user, token }) => {
  const [profile, setProfile] = useState(null);
  const [recyclingHistory, setRecyclingHistory] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    if (user && token) {
      fetchProfile();
      fetchRecyclingHistory();
    }
  }, [user, token]);

  const fetchProfile = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/users/profile', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setProfile(response.data);
    } catch (err) {
      setError('Failed to load profile information');
    }
  };

  const fetchRecyclingHistory = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/users/recycling-history', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setRecyclingHistory(response.data);
    } catch (err) {
      setError('Failed to load recycling history');
    } finally {
      setLoading(false);
    }
  };

  if (!user) {
    return (
      <div className="profile-container">
        <h2>Please log in to view your profile</h2>
      </div>
    );
  }

  if (loading) {
    return <div className="loading">Loading profile...</div>;
  }

  if (error) {
    return <div className="error">{error}</div>;
  }

  return (
    <div className="profile-container">
      <section className="profile-info">
        <h2>Profile Information</h2>
        <div className="profile-details">
          <p><strong>Username:</strong> {profile?.username}</p>
          <p><strong>Email:</strong> {profile?.email}</p>
          <p><strong>Member Since:</strong> {new Date(profile?.createdAt).toLocaleDateString()}</p>
        </div>
      </section>

      <section className="recycling-history">
        <h2>Recycling History</h2>
        {recyclingHistory.length === 0 ? (
          <p>No recycling history found.</p>
        ) : (
          <div className="history-list">
            {recyclingHistory.map(record => (
              <div key={record._id} className="history-item">
                <div className="history-details">
                  <h3>{record.facilityName}</h3>
                  <p>Date: {new Date(record.date).toLocaleDateString()}</p>
                  <p>Items Recycled: {record.items.join(', ')}</p>
                  <p>Weight: {record.weight} kg</p>
                </div>
                <div className="history-actions">
                  <button onClick={() => window.open(`https://maps.google.com/?q=${record.facilityAddress}`, '_blank')}>
                    View Facility
                  </button>
                </div>
              </div>
            ))}
          </div>
        )}
      </section>

      <section className="environmental-impact">
        <h2>Your Environmental Impact</h2>
        <div className="impact-stats">
          <div className="stat-card">
            <h3>Total Items Recycled</h3>
            <p>{recyclingHistory.reduce((sum, record) => sum + record.items.length, 0)}</p>
          </div>
          <div className="stat-card">
            <h3>Total Weight</h3>
            <p>{recyclingHistory.reduce((sum, record) => sum + record.weight, 0)} kg</p>
          </div>
          <div className="stat-card">
            <h3>CO2 Saved</h3>
            <p>{recyclingHistory.reduce((sum, record) => sum + record.co2Saved, 0)} kg</p>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Profile;
